import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
    <h1>Todo APP</h1>
      <input />
      <button>Add Todo</button>

      <ul>
      <li>Do laundry </li>
      <li>Play guitar </li>
      <li>Make App </li>
      <li> </li>
      </ul>


    </div>
  );
}

export default App;
